import { Outlet, useLocation } from 'react-router-dom'

import './App.css';
import Title from './components/Title';

function App(props) {
  const location = useLocation()
  const { name } = location.state
  console.log(location.state)
  return (
    <div>
      <Title name={name} />
      <Outlet />
    </div>
  );
}

export default App;
